import './App.css';

const getData = async() => {
  // const api_call = await fetch('https://api.covid19india.org/data.json');
  const api_call = await fetch('https://api.covid19api.com/summary')
  var response = await api_call.json;
  response = response.cases_time_series[0].dailyconfirmed;
  console.log(response);

}

function App() {
  return (
    <div className="App">
      {getData()}
    </div>
  );
}

export default App;
